import styled from "styled-components/native"

export const FirstFoodImage = styled.ImageBackground`
flex: 3;
margin-top: 28px;
height: 256px;
width: 428px;
`;

export const SecondFoodImage = styled.ImageBackground`
flex: 1;
height: 256px;
width: 179px;
`;

export const ThirdFoodImage = styled.ImageBackground`
